What's up?!&nbsp;
My arms is improving, the wound finally closed! FINALLY!!! They're taking out the stitches next week (just to be sure). I can dance and not worry that it will just bust open! HAHAHA!&nbsp;

I have some weird information to share. There's this "dance off" scene in step up (the movie). I have those clothes. HAHAHA! Maybe i'll dress up like just like that when I go to a party. Maybe girls will look at me. :p&nbsp;
Step up is my next favorite movie (After You got served).
